import React, { useState } from 'react';
import { Link } from 'react-router-dom';

export default function EmbeddedBooking() {
    const [isLoading, setIsLoading] = useState(true);
    const [hasError, setHasError] = useState(false);

    const bookingServiceUrl = 'http://bookingservice-alb-1975395896.us-east-1.elb.amazonaws.com/';

    const handleIframeLoad = () => {
        setIsLoading(false);
    };

    const handleIframeError = () => {
        setIsLoading(false);
        setHasError(true);
    };

    return (
        <div className="min-h-screen bg-gradient-to-br from-blue-50 via-white to-slate-50 py-8 px-4">
            <div className="max-w-7xl mx-auto">
                {/* Header */}
                <div className="mb-8">
                    <div className="flex items-center justify-between mb-6">
                        <div>
                            <h1 className="text-3xl font-bold text-slate-800 mb-2">External Booking Service</h1>
                            <p className="text-slate-600">Embedded booking service from AWS</p>
                        </div>
                        <Link
                            to="/"
                            className="px-4 py-2 bg-gradient-to-r from-blue-600 to-blue-700 text-white font-semibold rounded-xl shadow-md hover:from-blue-700 hover:to-blue-800 transition-all duration-200 hover:shadow-lg flex items-center gap-2"
                        >
                            <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 19l-7-7m0 0l7-7m-7 7h18" />
                            </svg>
                            Back to Home
                        </Link>
                    </div>

                    {/* URL Display */}
                    <div className="bg-white/80 backdrop-blur-xl rounded-xl p-4 border border-slate-200/50 mb-6">
                        <div className="flex items-center gap-3">
                            <div className="w-3 h-3 bg-green-500 rounded-full animate-pulse"></div>
                            <span className="text-sm font-medium text-slate-700">External Service URL:</span>
                            <code className="text-sm bg-slate-100 px-2 py-1 rounded text-blue-600 font-mono">
                                {bookingServiceUrl}
                            </code>
                        </div>
                    </div>
                </div>

                {/* Embedded Content */}
                <div className="bg-white/80 backdrop-blur-xl rounded-2xl shadow-lg border border-slate-200/50 overflow-hidden">
                    {/* Loading State */}
                    {isLoading && (
                        <div className="flex items-center justify-center h-64">
                            <div className="text-center">
                                <svg className="animate-spin h-8 w-8 text-blue-600 mx-auto mb-4" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                                    <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                                    <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                                </svg>
                                <p className="text-slate-600">Loading external booking service...</p>
                            </div>
                        </div>
                    )}

                    {/* Error State */}
                    {hasError && (
                        <div className="flex items-center justify-center h-64">
                            <div className="text-center">
                                <svg className="w-12 h-12 text-red-500 mx-auto mb-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 9v2m0 4h.01m-6.938 4h13.856c1.54 0 2.502-1.667 1.732-2.5L13.732 4c-.77-.833-1.964-.833-2.732 0L3.732 16.5c-.77.833.192 2.5 1.732 2.5z" />
                                </svg>
                                <h3 className="text-lg font-semibold text-slate-800 mb-2">Connection Error</h3>
                                <p className="text-slate-600 mb-4">Unable to load the external booking service.</p>
                                <a
                                    href={bookingServiceUrl}
                                    target="_blank"
                                    rel="noopener noreferrer"
                                    className="px-4 py-2 bg-blue-600 text-white font-semibold rounded-lg hover:bg-blue-700 transition-colors"
                                >
                                    Open in New Tab
                                </a>
                            </div>
                        </div>
                    )}

                    {/* Iframe */}
                    <iframe
                        src={bookingServiceUrl}
                        className={`w-full h-[800px] border-0 ${isLoading || hasError ? 'hidden' : ''}`}
                        onLoad={handleIframeLoad}
                        onError={handleIframeError}
                        title="External Booking Service"
                        sandbox="allow-same-origin allow-scripts allow-forms allow-popups allow-popups-to-escape-sandbox"
                    />
                </div>

                {/* Footer Info */}
                <div className="mt-6 text-center">
                    <p className="text-sm text-slate-500">
                        This is an embedded view of the external booking service running on AWS.
                    </p>
                </div>
            </div>
        </div>
    );
}
